    LANGUAGE plpgsql
    AS $$
BEGIN
    RETURN QUERY
    SELECT 
        ga.account_id,
        ga.balance,
        ga.currency,
        ga.status,
        COUNT(gt.transaction_id) as total_transactions,
        MAX(gt.created_at) as last_transaction_at
