    LANGUAGE plpgsql
    AS $$
BEGIN
    -- Update user level statistics
    UPDATE user_levels 
    SET 
        total_ggr = total_ggr + NEW.ggr_amount,
        updated_at = NOW()
    WHERE user_id = NEW.user_id;
    
